import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faStar } from "@fortawesome/free-solid-svg-icons";
import { faStarHalf } from "@fortawesome/free-solid-svg-icons";
import "bootstrap/dist/css/bootstrap.min.css";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Button from "react-bootstrap/Button";
import Image from "react-bootstrap/Image";

const Home = () => {
  return (
    <>
      <Container fluid="md">
        <Row className="">
          <Col sm={8} className="">
            <Button variant="outline-danger">Trench Apps</Button>
            <h1>
              Connecting people in <br /> Diaspora
            </h1>
            <p id="graph">
              connect across continents with people of the same cultural roots
              and interest as you! Our platform connects you with like-minded
              individuals across the globe.
            </p>

            <Row className=" mt-5">
              <Col sm={6} className="">
                <img
                  src="link4.png"
                  alt="applestoreimage"
                  style={{ width: 167, height: 50 }}
                />
              </Col>
              <Col sm={6}>
                <img
                  src="link3.png"
                  alt="applestoreimage"
                  style={{ width: 167, height: 50 }}
                />
              </Col>
            </Row>
            <div className="socialIcon">
              <FontAwesomeIcon icon={faStar} />
              <FontAwesomeIcon icon={faStar} />
              <FontAwesomeIcon icon={faStar} />
              <FontAwesomeIcon icon={faStar} />
              <FontAwesomeIcon icon={faStarHalf} />
              <span id="wp">150+ ratings</span>
            </div>
          </Col>
          <Col sm={4} className="">
            <div className="img">
              <Image src="first.png" alt="firstimg" id="firstImg" fluid />;
            </div>
          </Col>
        </Row>
      </Container>
    </>
  );
};
export default Home;
